import {Component} from "react"
import BubbleAlert from './BubbleAlert.js'

const styles= {
    carro: {
        backgroundColor: '#359A2C',
        color: '#fff',
        border: 'none',
        padding: '15px',
        borderRadius: '10px',
        cursor: 'pointer'
    },
    bubble: {
        position: 'relative',
        left: '12',
        bottom: '10'
    }
}
class Carro extends Component{
    render(){
        return(
            <div>
            <span style={styles.bubble}></span>
            <BubbleAlert/>
                <button style={styles.carro}>
                    Carrito
                </button>
            </div>
        )
    }
}

export default Carro
